import React from 'react';

import './ProjectsPage.scss';

function ProjectsPage() {
  return (
    <div className="ProjPageHolder">
    <div className="ProjectHolder">
      <h1 className="ProjTitle">Project Name</h1>
      <div id="ProjCarousel">
        <div id="ProjPicHolder">
          <button id="Left" className="ProjArrowBtn">&lt;</button>
          <img id="ProjPic" src={process.env.PUBLIC_URL + '/gamePreview.jpeg'} alt="Game1"></img>
          <button id="Right" className="ProjArrowBtn">&gt;</button>
        </div>
      </div>
      <h1 className="ProjTitle">Description</h1>
      <p className="ProjDescription">Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt
      ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco
      laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in
      voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat
      non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</p>
    </div>
    </div>
  );
}

export default ProjectsPage;
